function Main({ folderInfo, handleSearchChange }) {
  <>
    <div className="search-section">
      <div className="serch-inputbox">
        <img src={searchIcon} alt="검색 아이콘" />
        <input
          type="text"
          name="searchInput"
          value={search}
          placeholder="링크를 검색해 보세요."
          onChange={handleSearchChange}
        />
      </div>
      {loadingError && <div>{loadingError.message}</div>}
    </div>

    <CardList links={folderInfo?.lnks} />
  </>;
}

export default Main;
